import React from "react";
import "./style.css";

function Contact(props) {
  return (
    <div class="contact">
      <h1 class="xxlarge">contact me</h1>
      <hr />
      <a href="https://www.linkedin.com/in/cory-quirk/"><button class="contactBtns">
        <span><h3>LinkedIn <i class="fa fa-linkedin"></i></h3></span></button></a>
        <button class="contactBtns"><span><h3>Resum√© <i class="fa fa-file"></i></h3></span></button>
        <button class="contactBtns ">
        <span><h3>Email <i class="fa fa-envelope"></i></h3></span>
      </button>
      <button class="contactBtns"><span><h3>GitHub <i class="fa fa-github"></i></h3></span></button>
    </div>
  );
}

export default Contact;
